        private static List<MouserCategory> DeserializeCategories()
        {
            var response = JsonConvert.DeserializeObject<MouserCategoryResponse>(_categoriesJson);
            return response.Categories.ToList();
        }

        public void Validate()
        {
            // ensure deserialization doesn't blow up
            var test1 = _allCategories.Value;
            // ensure categories have unique key
            var test2 = _partTypeMappings.Value;
        }

        /// <summary>
        /// Maps a Mouser category to a Part Type Id
        /// </summary>
        /// <param name="category"></param>
        /// <returns></returns>
        public int? MatchToPartTypeId(MouserCategory category)
        {
            // try match by id
            if (category.Id > 0)
            {
                var match = MatchToPartTypeId(category.Id);
                if (match != null)
                    return match;
            }

            // try match by name
            return MatchToPartTypeId(category.Name);
        }

        /// <summary>
        /// Maps a Mouser category to a Part Type Id
        /// </summary>
        /// <param name="categoryId"></param>
        /// <returns></returns>
        public int? MatchToPartTypeId(int categoryId)
        {
            if (categoryId > 0 && _partTypeMappings.Value.ContainsKey(categoryId))
                return _partTypeMappings.Value[categoryId];
            return null;
        }

        /// <summary>
        /// Maps a Mouser category name to a Part Type Id
        /// </summary>
        /// <param name="name"></param>
        /// <returns></returns>
        public int? MatchToPartTypeId(string name)
        {
            if (!string.IsNullOrEmpty(name))
            {
                var match = RecursiveWhere(_allCategories.Value, name);
                if (match != null && _partTypeMappings.Value.ContainsKey(match.Id))
                    return _partTypeMappings.Value[match.Id];
            }
            return null;
        }

        private MouserCategory? RecursiveWhere(IEnumerable<MouserCategory> categories, string name)
        {
            if (!categories.Any())
                return null;
            var match = categories.FirstOrDefault(x => x.Name.Equals(name, StringComparison.InvariantCultureIgnoreCase));
            if (match == null)
                match = RecursiveWhere(categories.SelectMany(x => x.ChildCategories), name);
            return match;
        }

